import React from 'react';
import {Item} from './Item';

export function Lista({listaItems})
{
  const [data, setData] = useState([]);

  useEffect(() => {
    fetch('/api/data')
      .then((res) => res.json())
      .then((data) => {
        setData(data);
      })
      .catch((err) => {
        console.log(err);
      });
  }, []);
	return ( 
	<ul>
		 {data.map((item) => (
        <li key={item.id}>{item.name}</li>
      ))}
	{listaItems.map((item)=(
	<Item item={item}/>
	))}
	</ul>
	);
 }
